import React from "react";
import "./ExpenceData.css";
function ExpenceData(props) {
  const month = props.date.toLocaleString("en-US", { month: "long" });
  const year = props.date.toLocaleString("en-US", { day: "2-digit" });
  const day = props.date.getFullYear();

  return (
    <div>
      <div className="expence-date">{month}</div>
      <div className="expence-date__month">{year}</div>
      <div>{day}</div>
    </div>
  );
}

export default ExpenceData;
